window.bookSummaryJSON = "<p><b>The ultimate pilot has arrived. An unprecedented connection between man and machine.</b></p> <p>Five years ago, aliens destroyed a carrier and its airwing at Jupiter without warning. </p> <p>Since then, the Earth’s nations have learned to work together, and they want to know more about the aliens who appeared, attacked, and vanished without a trace. </p> <p>The Americans have provided a new carrier and a slew of space fighters. Chinese engine and gravity technology has made going after the invaders possible. And the Russians have developed a new control system for the American fighters that will give the craft never-before-seen capabilities. </p> <p>Most importantly, this blend of technology has allowed for pilots to connect directly to their ships, amplifying their reflexes and giving them the ultimate edge in combat.</p> <p>Mankind’s next war is upon us, and Uplink Squadron is the tip of the spear.</p> <p><b><i>It’s time to plug in and save the world.</i></b></p>"; 
